import React from 'react';
import BlogPost from '../Components/BlogPost.js'

function Main() {

    fetch('http://localhost:3001/allblogs').then(
        res => {
            return res.json()
        }
    ).then(
        response => {
            const Posts = response.res
            console.log(Posts)
        }
    )
    return (
        <div>
            <BlogPost />
        </div>
    )
}

export default Main;
